import React from 'react';
import logo from './logo.svg';
import './App.css';
import Dialog from './Dialog/Dialog';

function App() {
  return (
    <div className="App">
      <header className="App-header">       
          Learn React       
      </header>
      <Dialog></Dialog>
    </div>
  );
}

export default App;
